// Styles
import { SimpleGrid, ListItem } from '@chakra-ui/core';

const ItemLayout = (props) => (
  <ListItem paddingBottom="0.5rem">
    <SimpleGrid columns="3">{props.children}</SimpleGrid>
  </ListItem>
);

export default ItemLayout;
